import React from 'react';

export default class Users extends React.Component {
	constructor(){
		super()
		this.state = {
			username: ''
		}
	}

	// getUsername(){
	// 	return this.state.username
	// }

	setUsername(){
		this.setState({
			username: 'user01'
		})
	}

	render() {
		return (
			// <h1>{this.getUsername()}</h1>
			<div>
				<h1>{this.state.username}</h1>
				<br />
				<button onClick={this.setUsername}> Set Username</button>
			</div>
		)
	}
}
